import{_ as e,o,c as n,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 55.1-2818 Effect on existing fence laws or no-fence laws.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2818.md","filePath":"vacode/55.1-2818.md"}'),t={name:"vacode/55.1-2818.md"},r=a('<h1 id="§-55-1-2818-effect-on-existing-fence-laws-or-no-fence-laws" tabindex="-1">§ 55.1-2818 Effect on existing fence laws or no-fence laws. <a class="header-anchor" href="#§-55-1-2818-effect-on-existing-fence-laws-or-no-fence-laws" aria-label="Permalink to &quot;§ 55.1-2818 Effect on existing fence laws or no-fence laws.&quot;">​</a></h1><p>Nothing in § <a href="/vacode/55.1-2814/">55.1-2814</a> shall repeal the existing fence laws in any county, magisterial district, or selected portion of any county, until changed by the board of supervisors or other governing body, by ordinance and in accordance with the provisions thereof, nor shall the provisions of § <a href="/vacode/55.1-2814/">55.1-2814</a> apply to any county, magisterial district, or selected portion of any county in which the no-fence law is now in force, if such no-fence law exists otherwise than in an ordinance adopted by the board of supervisors or other governing body of such county entered pursuant to § <a href="/vacode/55.1-2814/">55.1-2814</a>.</p><p>Code 1950, § 8-884; 1977, c. 624, § 55-314; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),i=[r];function c(s,f,l,d,h,_){return o(),n("div",null,i)}const u=e(t,[["render",c]]);export{g as __pageData,u as default};
